import React, {useState, useEffect} from 'react';


function Lista () {      

  const [lomake, setLomake] = useState({id: '', mac: '', aika: ''});

  const fetchUrl = async () => {
    try {
        const response = await fetch('http://localhost:8080/person/all');
        const json = await response.json();

        setLomake({ id: json.id, mac: json.btdata, kaupunki: json.datetime})  

        console.log(json);

    } catch (error) {
        console.log(error);
    } 
  }

  useEffect( () => { fetchUrl() }, []);

    return (
        <div style={{paddingLeft: '10px', fontSize: 12}}>
                 <p>
                   Nimi: { lomake.id }<br/>
                   Käyttäjä: { lomake.btdata }<br/>
                   Kaupunki: { lomake.datetime }<br/>
                 </p>
      </div>
      );
    }


  export default Lista;
